import React from 'react';
import { TextField } from '@material-ui/core';
import { ErrorMessage } from 'formik';

export default (props) => (
    <React.Fragment>
        <TextField
            margin="normal"
            style = {{width: '80%'}}
            variant="outlined"
            {...props}
        />
        <ErrorMessage name={props.name} render={(msg) =>
            <div style={{ color: 'red', width: '80%' }}>{msg}</div>
        }/>
    </React.Fragment>
);
